import React from "react";
import { useNavigate } from "react-router-dom";
import { IconButton, InputBase } from "@material-ui/core";
import { Search as SearchIcon, Settings as SettingsIcon, Notifications as NotificationsIcon } from "@material-ui/icons";
import "./navbar.css";

const Navbar = () => {
  const navigate = useNavigate();

  function handleLogout() {
    navigate("/");
  }

  return (
    <div className="navbar">
      <div className="navbar-logo">Logo</div>
      <div className="navbar-search">
        <div className="search-icon">
          <SearchIcon />
        </div>
        <InputBase placeholder="Search" />
      </div>
      <div className="navbar-icons">
        <IconButton onClick={() => console.log("Settings clicked")} className="navbar-icon">
          <SettingsIcon />
        </IconButton>
        <IconButton onClick={() => console.log("Notifications clicked")} className="navbar-icon">
          <NotificationsIcon />
        </IconButton>
        <div className="navbar-icon" onClick={handleLogout}>
          Logout
        </div>
      </div>
    </div>
  );
};

export default Navbar;
